// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Employees is Ownable {
    uint8 public counter;
    IERC20 paymentVault;

    struct Employee {
        string name;
        string position;
        uint dateOfBirth;
        uint salary;
        uint voteWeight;
        address walletAddress;
    }

    mapping(uint256 => Employee) public employees;

    constructor() {}

    // Create New Employee
    function addEmployee(
        string memory _name,
        string memory _position,
        uint256 _dob,
        uint256 _salary,
        uint256 _vWeight,
        address _wallet
    ) public onlyOwner {
        Employee storage employee = employees[counter];
        employee.name = _name;
        employee.position = _position;
        employee.dateOfBirth = _dob;
        employee.salary = _salary;
        employee.voteWeight = _vWeight;
        employee.walletAddress = _wallet;

        unchecked {
            counter++;
        }
    }
    // Delete Employee
